INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (1, N'Caption Americal thế giới mới', N'​"Captain America: Thế Giới Mới" là bộ phim siêu anh hùng của Marvel Studios, dự kiến khởi chiếu vào ngày 14 tháng 2 năm 2025. Trong phim, Sam Wilson tiếp nhận vai trò Captain America sau sự kiện "Avengers: Endgame". Anh phải đối mặt với những thách thức mới và hợp tác với các đồng minh để bảo vệ thế giới', N'Tiếng Anh', N'Khoa học viễn tưởng', CAST(N'2025-02-14' AS Date), 122, N'./assets/ImageUrl/Caption.png', N'Harrison Ford, Anthoy Mackie, Giancarlo Esposito, Rosa Salazar, Seth Rollins, Shira Haas', N'Julius Onah', N'Dành cho người trên 13 tuổi', N'./assets/Video/Caption.mp4')
INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (2, N'Nhà Gia Tiên 1234 abc', N'"Nhà Gia Tiên" là phim kinh dị - hài Việt Nam ra mắt năm 2025. Mỹ Tiên trở về nhà tổ để quay video và gặp hồn ma anh trai đã mất 10 năm trước. Cả hai cùng hợp sức bảo vệ ngôi nhà trước tranh chấp gia tộc.', N'Tiếng Việt', N'Kinh dị', CAST(N'2025-01-18' AS Date), 116, N'./assets/ImageUrl/Nhagiatien.png', N'Huỳnh Lập, Phương Mỹ Chi, NSƯT Hạnh Thúy, NSƯT Ngọc Hiệp, Hồng Đào, Anh Tú, Trương Thế Vinh, Trương Minh Quốc Thái, Tiểu Bảo Quốc, NSƯT Thanh Hằng, NSƯT Hiền Anh', N'Huỳnh Lập', N'Dành cho người trên 18', N'./assets/Video/Nhagiatien.mp4')
INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (3, N'Nữ Tu Bóng Tối', N'"Nữ Tu Bóng Tối" là phim kinh dị kể về ma sơ Valak, linh hồn ác quỷ gieo rắc nỗi kinh hoàng. Một nữ tu trẻ và cha xứ điều tra những hiện tượng kỳ bí tại tu viện cổ. Bí ẩn đen tối dần được hé lộ, đẩy họ vào cuộc chiến sinh tồn.', N'Tiếng Hàn ', N'Kinh dị', CAST(N'2025-02-21' AS Date), 114, N'./assets/ImageUrl/Nutubongtoi.png', N'Song Hye-kyo; Jeon Yeo-been; Lee Jin-wook', N'Hyeok-jae Kwon', N'Dành cho người trên 18 tuổi
', N'./assets/Video/Nutubongtoi.mp4')
INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (4, N'Na Tra 2', N'"Na Tra 2" tiếp tục câu chuyện về Na Tra sau trận chiến với Thiên Cung. Cậu đối mặt với thử thách mới, khám phá sức mạnh tiềm ẩn và định mệnh của mình. Phim mang đến những pha hành động mãn nhãn và cốt truyện hấp dẫn.', N'Trung Quốc', N'Hoạt hình 3D', CAST(N'2025-01-27' AS Date), 121, N'./assets/ImageUrl/Natra2.png', N'Chen Hao, Chen Houlin, Gong Geer, Han Mo, Huan Ting, Joseph, Li Nan, Liang Sheng, Ling Qi, Lü Qi,', N'Yang Yu', N'Dành cho mọi lứa tuổi', N'./assets/Video/Natra2.mp4')
INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (10, N'Kẻ Đồng Hành', N'"Kẻ đồng hành" Cái chết của một tỷ phú đã khơi mào chuỗi sự kiện kinh hoàng cho Iris và bạn bè của cô trong kỳ nghỉ cuối tuần tại khu biệt thự ven hồ. Kéo theo đó, những bí mật đen tối nhất trong chuyện tình của "cặp đôi hoàn hảo" Iris - Josh cũng dần bại lộ.', N'Tiếng Anh – Phụ đề Tiếng Việt', N'Bí ẩn, Hồi hộp, Khoa Học Viễn Tưởng, Kinh Dị', CAST(N'2025-02-14' AS Date), 97, N'./assets/ImageUrl/kedonghanh.png', N'Sophie Thatcher, Jack Quaid, Lukas Gage, Harvey Guillén,...', N'Drew Hancock', N'Dành cho người trên 13 tuổi', N'./assets/Video/Kedonghanh.mp4')
INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (11, N'Vùng Đất Linh Hồn (Spirited Away)', N'Câu chuyện về cô bé Chihiro lạc vào thế giới linh hồn và hành trình tìm cách giải cứu cha mẹ mình.', N'Tiếng Nhật', N'Hoạt hình, Phiêu lưu, Thần thoại', CAST(N'2025-01-03' AS Date), 125, N'./assets/ImageUrl/Vungdatlinhhon.png', N'Rumi Hiiragi (Chihiro), Miyu Irino (Haku), Mari Natsuki (Yubaba)', N'Hayao Miyazaki', N'Dành cho mọi lứa tuổi', N'./assets/Video/Vungdatlinhhon.mp4')
INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (14, N'Mưa Trên Cánh Bướm', N'Bộ phim Việt Nam giành giải tại Liên hoan phim Venice, kể về hành trình tìm kiếm ý nghĩa cuộc sống của nhân vật chính.', N'Tiếng Việt', N'Tâm lý, Tình cảm', CAST(N'2025-01-03' AS Date), 108, N'./assets/ImageUrl/Muatrencanhbuom.png', N'Song Luân, Kiều Minh Tuấn ', N'Phan Gia Nhật Linh', N'Dành cho người trên 16 tuổi', N'./assets/Video/Muatrencanhbuom.mp4')
INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (15, N'Tình Người Duyên Ma', N'Tiếp tục câu chuyện tình yêu giữa người và ma, với những tình huống dở khóc dở cười.', N'Tiếng Thái', N'Kinh dị, Hài hước', CAST(N'2025-01-03' AS Date), 122, N'./assets/ImageUrl/Tinhnguoiduyenma.png', N'Bright Vachirawit,Baifern Pimchanok', N'Baz Poonpiriya', N'Dành cho người trên 18 tuổi', N'./assets/Video/Tinhnguoiduyenma.mp4')
INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (17, N'Elio', N'Bộ phim kể về Elio, một cậu bé 11 tuổi bị cuốn vào một cuộc phiêu lưu liên thiên hà khi vô tình được chọn làm đại sứ của Trái Đất tại "Hiệp hội Liên Thiên Hà', N'Tiếng Anh', N'Hoạt hình, Khoa học viễn tưởng, Phiêu lưu ', CAST(N'2025-02-12' AS Date), 115, N'./assets/ImageUrl/Elio.png', N'Yonas Kibreab, America Ferrera, Jameela Jamil , Brad Garrett ', N'Adrian Molina', N'Dành cho mọi trên 13 tuổi', N'./assets/Video/Elio.mp4')
INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (18, N'Plankton: The Movie', N' Bộ phim tập trung vào nhân vật Plankton từ loạt phim "SpongeBob SquarePants", theo chân anh ta trong một kế hoạch mới đầy tham vọng nhằm chiếm lấy công thức bí mật của Krabby Patty', N'Tiếng Anh', N'Hoạt hình, Hài hước, Phiêu lưu Thời lượng', CAST(N'2025-03-01' AS Date), 95, N'./assets/ImageUrl/Plank.png', N'Mr. Lawrence, Jill Talley, Tom Kenny, Bill Fagerbakke, Carolyn Lawrence, Clancy Brown, Rodger Bumpass.', N'Dave Needham', N'Dành cho mọi lứa tuổi', N'./assets/Video/Plankton.mp4')
INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (19, N'Zootopia 2', N'Phần tiếp theo của bộ phim nổi tiếng "Zootopia", tiếp tục theo chân thỏ cảnh sát Judy Hopps và cáo Nick Wilde trong những cuộc phiêu lưu mới tại thành phố động vật Zootopia', N'Tiếng Anh', N'Hoạt hình, Phiêu lưu, Hài hước ', CAST(N'2025-02-17' AS Date), 110, N'./assets/ImageUrl/Zootopia2.png', N'Ginnifer Goodwin, Jason Bateman, Quan Kế Huy (Ke Huy Quan), Fortune Feimster, Shakira.', N'Jared Bush và Byron Howard', N'Dành cho mọi lứa tuổi', N'./assets/Video/Zootopia2.mp4')
INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (20, N'Family Ties', N'Một gia đình Đức đối mặt với những thử thách và bí mật được tiết lộ khi họ tụ họp trong một kỳ nghỉ cuối tuần.', N'Tiếng Đức', N'Gia đình, Chính kịch', CAST(N'2025-01-20' AS Date), 115, N'./assets/ImageUrl/Family.png', N'Daniel Brühl, Nina Hoss', N'Florian Henckel von Donnersmarck', N'Dành cho người trên 13 tuổi', N'./assets/Video/Family.mp4')
INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (21, N'Love Scout (Thư ký hoàn hảo của tôi)', N'Câu chuyện về Kang Ji Yoon, một giám đốc điều hành tài năng trong lĩnh vực tuyển dụng, và những mối quan hệ phức tạp trong công việc và tình yêu.', N'Tiếng Hàn', N'Tình cảm, Lãng mạn', CAST(N'2025-01-03' AS Date), 112, N'./assets/ImageUrl/Love.png', N'Han Ji Min (Kang Ji Yoon)', N'Lee Eung-bok', N'Dành cho người trên 16 tuổi', N'./assets/Video/Love.mp4')
INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (22, N'When the Stars Gossip (Hỏi các vì sao)', N'Câu chuyện về bác sĩ sản phụ khoa Gong Ryong, người du hành vào vũ trụ với một mục đích đặc biệt.', N'Tiếng Hàn', N'Chính kịch, Lãng mạn', CAST(N'2025-01-03' AS Date), 118, N'./assets/ImageUrl/when.png', N'Lee Min Ho (Gong Ryong), Gong Hyo Jin', N'Kim Eun-sook', N'Dành cho người trên 16 tuổi', N'./assets/Video/Star.mp4')
INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (23, N'Den of Thieves 2: Pantera', N'Phần tiếp theo của bộ phim tội phạm nổi tiếng, tiếp tục theo chân nhóm cướp ngân hàng chuyên nghiệp và cuộc đối đầu căng thẳng với lực lượng cảnh sát.', N'Tiếng Anh', N'Hành động, Tội phạm', CAST(N'2025-01-10' AS Date), 119, N'./assets/ImageUrl/hanhdong.png', N'Gerard Butler,O''Shea Jackson Jr.,Evin Ahmad ', N'Christian Gudegast', N'Dành cho người trên 16 tuổi', N'./assets/Video/Den.mp4')
INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (24, N'Wolf Man', N'Câu chuyện hiện đại về người sói, khi một người đàn ông bị nguyền rủa biến thành sinh vật đáng sợ dưới ánh trăng tròn.', N'Tiếng Anh', N'Hành động, Kinh dị', CAST(N'2025-01-17' AS Date), 120, N'./assets/ImageUrl/Nguoisoi.png', N'Christopher Abbott, Julia Garner, Sam Jaeger', N'Leigh Whannell', N'Dành cho người trên 18 tuổi', N'./assets/Video/Man.mp4')
INSERT [dbo].[Movie] ([MovieID], [MovieTitle], [MovieDescription], [MovieLanguage], [MovieGenre], [MovieReleaseDate], [MovieRuntime], [ImageUrl], [MovieActor], [MovieDirector], [MovieAge], [MovieTrailer]) VALUES (25, N'The Running Man', N'Phiên bản làm lại của bộ phim kinh điển, theo chân một người đàn ông tham gia vào trò chơi sinh tử trên truyền hình để giành lại tự do.', N'Tiếng Anh', N'Hành động, Khoa học viễn tưởng', CAST(N'2025-03-24' AS Date), 119, N'./assets/ImageUrl/The.png', N'Henry Cavill,Tom Hardy', N'Matthew Vaughn', N'Dành cho người trên 13 tuổi', N'./assets/Video/Running.mp4')
